import MainAside from '././components/MainAside/MainAside';
import Upload from '././components/Upload/Upload';


const API_URL = '7f04c159-f06c-415a-ab44-82b82e7c16f8';
function App() {
  return (
    <>
    <BrowserRouter>
      <Header /> 
      <Hero />

            <section className="Main">     
            <MainLeft />
            <MainAside />

            </section>     
      <Upload />
      <Switch>
          <Route className="Header__link" path="/UploadPage" exact component = {UploadPage} />
          </Switch>
      </BrowserRouter>
    </>
  );
}

export default App;
export { API_URL };

